// Import the React and ReactDOM libraries 
import ReactDOM from 'react-dom';
import { Link, Route, Router, Switch } from 'react-router-dom';
import './style.scss';
import React, { Component } from 'react';
import AboutUs from './aboutUs';
import Footer from './footer';
import Navigation from './navBar';
import House from './houses';
import Investments from './investments';
import Button from './buttons';
import ContactUs from './contactUs';
import Faker from 'faker';

class App extends Component {
  render(){
    return(
      <>
        <Router>
          <h1>Title</h1>
          <div>
            <Link to="/">Home</Link>
            <Link to={{pathname: '/aboutUs'}}>About Us</Link>
            <Link to={{pathname: '/house'}}>Houses</Link>
            <Link to={{pathname: '/investments'}}>Investments</Link>
            <Link to={{pathname: '/contactUs'}}>Contact Us</Link>
            <Switch>
              <Route exact path="/aboutUs" component={AboutUs} />
              <Route exact path="/house" component={House} />
              <Route exact path="/investments" component={Investments} />
              <Route exact path="/contactUs" component={ContactUs} />

            </Switch>

            <Navigation>
              <Link to="/about" component={AboutUs}></Link> 
              <Link to="/contact" component={ContactUs}></Link>
              <Link to="/house" component={House}></Link>
              <Link to="/investments" component={Investments}></Link>
              <Link to="/house" component={House}></Link>
            </Navigation>
          </div>
          <img src="../assets/house.jpg" alt="house"></img> 
          <Button />
          <Footer />
        </Router>
      </>
      )
    }
  }

  // Take the react component and show it on the screen 
  ReactDOM.render(
      <App />, 
    document.querySelector('#root')
    );
